# device_supplies

devices = Device.all

devices.each do |device|
  10.times do |i|
    device.device_supplies.build(supply: supplies.sample, cuantity: i+1 )
  end
  device.device_supplies.build(supply: lubricante, cuantity: 1, lubrication: true )
  device.save!
end

# Instruments
instrument_temperatura = InstrumentType.create(name: "Temperatura")
instrument_presion = InstrumentType.create(name: "Presión")
instrument_caudal = InstrumentType.create(name: "Caudal")
instrument_vacio = InstrumentType.create(name: "Vacio")

devices.each do |device|
  device.device_supplies.build(supply: supplies.sample, instrument_type: instrument_temperatura, cuantity: 1 )
  device.device_supplies.build(supply: supplies.sample, instrument_type: instrument_presion, cuantity: 1 )
  device.device_supplies.build(supply: supplies.sample, instrument_type: instrument_caudal, cuantity: 1 )
  device.device_supplies.build(supply: supplies.sample, instrument_type: instrument_vacio, cuantity: 1 )
  device.save!
end
